css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: #666666;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #9f9f9f;
  background-color: #ccc;
}
.github-tab-icon {
  color: #9f9f9f;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #c2c2c2;
  border-radius: 2px;
  padding: 0 .25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: #fff;
  box-shadow: 0 1px 0 #888;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #444;
}
